import React from 'react';
import Header from '../Header';
// import './Layout.css'; // Assuming you will create a CSS file for additional styles

const Layout: React.FC<{ children: React.ReactNode }> = ({ children }) => {
    return (
        <div className="flex">
            <div className="w-1/2">
                <img src="/path/to/your/image.jpg" alt="Description" className="w-full h-auto" />
            </div>
            <div className="w-1/2 bg-white flex flex-col">
                <Header />
                <div className="flex-grow flex items-center justify-center">
                    <div className="flex flex-col space-y-4">
                        <button className="bg-[#C4F439] text-white rounded-full py-2 px-4">
                            Iniciar sesión
                        </button>
                        <button className="bg-black text-white rounded-full py-2 px-4">
                            Otra acción
                        </button>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Layout;
